import React from 'react';
import './home.css';
import Footer from './footer';
import Header from './header';
import chest from './homeAssets/chest.png';
import reward from './homeAssets/trophy.png';
import star from './homeAssets/star.png';

function Home() {
  const enterLesson = () => {
    // Gérer l'événement de clic du bouton ici
    console.log('Bouton rond cliqué !');
  };

  return (
    <div className="app-container">

      <Header />

      <main className="main-content">
        <div className="ads">
          <h1>ads</h1>
        </div>
        <div className="lessonSection">
          <button className="round-button left" onClick={enterLesson}>
            <img src={star} alt="Icon" className="button-icon" />
          </button>
          <button className="round-button right locked" onClick={enterLesson}>
            <img src={star} alt="Icon" className="button-icon" />
          </button>
          <button className="round-button left locked" onClick={enterLesson}>
            <img src={chest} alt="Icon" className="button-icon" />
          </button>
          <button className="round-button right locked" onClick={enterLesson}>
            <img src={star} alt="Icon" className="button-icon" />
          </button>
          <button className="round-button left locked" onClick={enterLesson}>
            <img src={star} alt="Icon" className="button-icon" />
          </button>
          <button className="round-button right locked" onClick={enterLesson}>
            <img src={reward} alt="Icon" className="button-icon" />
          </button>
        </div>
        <div className="ads">
          <h1>ads</h1>
        </div>

      </main>
      <Footer />

    </div>
  );
}

export default Home;
